import React from "react";
import {NavLink, Route, Redirect} from "react-router-dom";
import HTML from "../courses/HTML";
import CSS from "../courses/CSS";
import JS from "../courses/JS";


const Courses = ({ match }) => {
    return (
        <div>
           <div>
               <h2>Courses</h2>
               <ul>
                   <li><NavLink to={`${match.url}/html`}>HTML</NavLink></li>
                   <li><NavLink to={`${match.url}/css`}>CSS</NavLink></li>
                   <li><NavLink to={`${match.url}/js`}>JS</NavLink></li>
               </ul>
           </div>

            <Route exact path={`${match.path}`} render={() => <Redirect to="/courses/html"/>}/>
            <Route path={`${match.path}/html`} component={HTML}/>
            <Route path={`${match.path}/css`} component={CSS}/>
            <Route path={`${match.path}/js`} component={JS}/>
        </div>
    );
};

export default Courses;
